	/**
	 * Returns the number of rows matching criteria, joining all related tables
	 *
	 * @param      Criteria $criteria
	 * @param      boolean $distinct Whether to select only distinct columns; deprecated: use Criteria->setDistinct() instead.
	 * @param      PropelPDO $con
	 * @param      String    $join_behavior the type of joins to use, defaults to Criteria::LEFT_JOIN
	 * @return     int Number of matching rows.
	 */
	public static function doCountJoinAll(Criteria $criteria, $distinct = false, PropelPDO $con = null, $join_behavior = Criteria::LEFT_JOIN)
	{
		// we're going to modify criteria, so copy it first
		$criteria = clone $criteria;

		// We need to set the primary table name, since in the case that there are no WHERE columns
		// it will be impossible for the BasePeer::createSelectSql() method to determine which
		// tables go into the FROM clause.
		$criteria->setPrimaryTableName(TbalunomatriculaPeer::TABLE_NAME);

		if ($distinct && !in_array(Criteria::DISTINCT, $criteria->getSelectModifiers())) {
			$criteria->setDistinct();
		}

		if (!$criteria->hasSelectClause()) {
			TbalunomatriculaPeer::addSelectColumns($criteria);
		}
		
		$criteria->clearOrderByColumns(); // ORDER BY won't ever affect the count
		
		// Set the correct dbName
		$criteria->setDbName(self::DATABASE_NAME);

		if ($con === null) {
			$con = Propel::getConnection(TbalunomatriculaPeer::DATABASE_NAME, Propel::CONNECTION_READ);
		}

		$criteria->addJoin(TbalunomatriculaPeer::ID_NECES_ESPECIAL, TbnecesespecialPeer::ID_NECES_ESPECIAL, $join_behavior);

		$criteria->addJoin(TbalunomatriculaPeer::NATURALIDADE, TbcidadePeer::ID_CIDADE, $join_behavior);

		$criteria->addJoin(TbalunomatriculaPeer::NACIONALIDADE, TbpaisPeer::ID_PAIS, $join_behavior);

		$criteria->addJoin(TbalunomatriculaPeer::CEP, TblogradouroPeer::CEP, $join_behavior);

		$criteria->addJoin(TbalunomatriculaPeer::ID_VERSAO_CURSO, TbcursoversaoPeer::ID_VERSAO_CURSO, $join_behavior);

		$criteria->addJoin(TbalunomatriculaPeer::ID_TIPO_INGRESSO, TbtipoingressoPeer::ID_TIPO_INGRESSO, $join_behavior);

		$criteria->addJoin(TbalunomatriculaPeer::ID_SITUACAO, TbalunosituacaoPeer::ID_SITUACAO, $join_behavior);

		$criteria->addJoin(TbalunomatriculaPeer::ID_2GRAU, TbinstexternaPeer::ID_INST_EXTERNA, $join_behavior);

		$criteria->addJoin(TbalunomatriculaPeer::ID_POLO, TbpolosPeer::ID_POLO, $join_behavior);

		$criteria->addJoin(TbalunomatriculaPeer::ID_RACA, TbalunoracacorPeer::ID_RACA, $join_behavior);

		// symfony_behaviors behavior
		foreach (sfMixer::getCallables(self::getMixerPreSelectHook(__FUNCTION__)) as $sf_hook)
		{
		  call_user_func($sf_hook, 'BaseTbalunomatriculaPeer', $criteria, $con);
		}

		$stmt = BasePeer::doCount($criteria, $con);

		if ($row = $stmt->fetch(PDO::FETCH_NUM)) {
			$count = (int) $row[0];
		} else {
			$count = 0; // no rows returned; we infer that means 0 matches.
		}
		$stmt->closeCursor();
		return $count;
	}

