	{

		if (null !== ($obj = TbalunomatriculaPeer::getInstanceFromPool((string) $pk))) {
			return $obj;
		}

		if ($con === null) {
			$con = Propel::getConnection(TbalunomatriculaPeer::DATABASE_NAME, Propel::CONNECTION_READ);
		}

		$criteria = new Criteria(TbalunomatriculaPeer::DATABASE_NAME);
		$criteria->add(TbalunomatriculaPeer::MATRICULA, $pk);

		$v = TbalunomatriculaPeer::doSelect($criteria, $con);

